import React from 'react';
import YourRSVP from './YourRSVP/YourRSVP';

const yourrsvps = (props) => {
    return props.events.map((event, index) => {
        return <YourRSVP
            click={() => props.clicked(index)}
            name={event.Event.event_name}
            app={event.Event.app}
            appdes={event.Event.app_description}
            entree={event.Event.entree}
            entreedes={event.Event.entree_description}
            dessert={event.Event.dessert}
            dessertdes={event.Event.dessert_description}
            key={event.id}
        />
    });
};

export default yourrsvps;
